//autogenerated:yes
//nolint:revive,govet,errcheck
package marsh

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_MOTION_PLATFORM_MODE(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e MOTION_PLATFORM_MODE
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := MOTION_PLATFORM_MODE_UNKNOWN.MarshalText()
		require.NoError(t, err)

		var dec MOTION_PLATFORM_MODE
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, MOTION_PLATFORM_MODE_UNKNOWN, dec)
	})
}
